import Logo from './Logo.png'

function NavBar() {
  return (
    <nav className='nav'>
        <img src={Logo} alt='logo'/>
        <ul>
            <li>Cocktails</li>
            <li>Cocktails</li>
            <li>Cocktails</li>
        </ul>
    </nav>
  )
}

export default NavBar;
